import React,{Component} from "react";

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {date: new Date()};
  }

  render() {
    return (
      <div>
        <h1>Hello, world!</h1>
        <h2>It is {this.state.date.toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

class App extends Component{
	
	constructor(props){
		super(props);
	}
	
	render(){
		return(
			<>
				<Clock/>
				<Clock/>
				<Clock/>
			</>
		);
	}
}



export default Clock;
